import React from 'react';
import { Section, Container, Heading } from 'react-bulma-components';

export const CreateNewLocation = () => {
    return (
        <div >
            <Section>
                <Container>
                    <Heading>Create New Location</Heading>
                </Container>
            </Section>
        </div>
    );
}
